import React from "react";
import importFishStyle from "../../styles/ImportFish.module.scss";
const ImportFish = () => {
  return (
    <div className={importFishStyle.importFish}>
      <h2 id="hometitle" className={importFishStyle.homeTitle}>
        Cá Biển Nhập Khẩu
      </h2>
      <div id="product" className="row">
        <div className="col-6 col-sm-3">
          <div className={importFishStyle.card}>
             <img className={importFishStyle.img} src="http://www.vanthinhseafoods.com/images/Sanphamseafood/RED%20SQUIRED/Red%20Squirel%20fish.jpg" alt="ca-bien-khoi-xa." width="250"/>
             <div className={importFishStyle.container}>
                <h4>Cá gì đó</h4>
                <p className="text-danger">Giá bán: 200,000 đ</p>
             </div>
          </div>
        </div>
        
      </div>
    </div>
  );
};

export default ImportFish;
